import React from 'react';
import { Outlet, Link } from 'react-router-dom';

const AdminLayout = () => {
  return (
    <div className="flex">
      <aside className="w-64 min-h-screen bg-gray-800 text-white">
        <div className="p-4">
          <h2 className="text-xl font-semibold">Admin Dashboard</h2>
        </div>
        <nav className="mt-4">
          <Link to="/admin" className="block px-4 py-2 hover:bg-gray-700">
            Dashboard
          </Link>
          <Link to="/admin/products" className="block px-4 py-2 hover:bg-gray-700">
            Products
          </Link>
          <Link to="/admin/categories" className="block px-4 py-2 hover:bg-gray-700">
            Categories
          </Link>
        </nav>
      </aside>
      <main className="flex-1 p-8">
        <Outlet />
      </main>
    </div>
  );
};

export default AdminLayout;
